            181 => 
            array (
                'id' => 182,
                'order' => '7',
                'article_id' => 3,
                'content' => '夫樂□□□[7]以得志於天下。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            182 => 
            array (
                'id' => 183,
                'order' => '8',
                'article_id' => 3,
                'content' => '古（故）吉事上左，喪事上右。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            183 => 
            array (
                'id' => 184,
                'order' => '8',
                'article_id' => 3,
                'content' => '是以卞（偏）（將）[8]軍居左，上（將）軍居右，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            184 => 
            array (
                'id' => 185,
                'order' => '9',
                'article_id' => 3,
                'content' => '言以喪豊（禮）居之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            185 => 
            array (
                'id' => 186,
                'order' => '9',
                'article_id' => 3,
                'content' => '古（故）【殺】□□，[9]則以（哀）悲位（莅）之；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            186 => 
            array (
                'id' => 187,
                'order' => '10',
                'article_id' => 3,
                'content' => '戰（勝）則以喪豊（禮）居之。[10]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            187 => 
            array (
                'id' => 188,
                'order' => '11',
                'article_id' => 3,
                'content' => '為之者敗之，執之者（失）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            188 => 
            array (
                'id' => 189,
                'order' => '11',
                'article_id' => 3,
                'content' => '聖人無為，古（故）無敗也；無執，古（故）□□□。[11]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            189 => 
            array (
                'id' => 190,
                'order' => '12',
                'article_id' => 3,
                'content' => '（慎）終若（始），則無敗事喜（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            190 => 
            array (
                'id' => 191,
                'order' => '12',
                'article_id' => 3,
                'content' => '人之敗也，亙（恆）於其（且）成也敗之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:51',
            ),
            191 => 
            array (
                'id' => 192,
                'order' => '12',
                'article_id' => 3,
                'content' => '是以□[12]人欲不欲，不貴戁（難）得之貨；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:51',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            192 => 
            array (
                'id' => 193,
                'order' => '13',
                'article_id' => 3,
                'content' => '學不學，復眾之所（過）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            193 => 
            array (
                'id' => 194,
                'order' => '13',
                'article_id' => 3,
                'content' => '是以能（輔）（萬）勿（物）[13]之自肰（然），而弗敢為。[14]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            194 => 
            array (
                'id' => 195,
                'order' => '1',
                'article_id' => 4,
                'content' => '大（太）一生水，水反（輔）大（太）一，是以成天。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            195 => 
            array (
                'id' => 196,
                'order' => '1',
                'article_id' => 4,
                'content' => '天反（輔）大（太）一，是以成（地）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            196 => 
            array (
                'id' => 197,
                'order' => '1',
                'article_id' => 4,
                'content' => '天【】（地）□□□[1]也，是以成神明。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            197 => 
            array (
                'id' => 198,
                'order' => '2',
                'article_id' => 4,
                'content' => '神明復相（輔）也，是以成（陰）昜（陽）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            198 => 
            array (
                'id' => 199,
                'order' => '2',
                'article_id' => 4,
                'content' => '（陰）昜（陽）復相（輔）也，是以成四時。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            199 => 
            array (
                'id' => 200,
                'order' => '2',
                'article_id' => 4,
                'content' => '四時[2]復（輔）也，是以成倉（凔）然（熱）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            200 => 
            array (
                'id' => 201,
                'order' => '3',
                'article_id' => 4,
                'content' => '倉（凔）然（熱）復相（輔）也，是以成溼澡（燥）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            201 => 
            array (
                'id' => 202,
                'order' => '3',
                'article_id' => 4,
                'content' => '溼澡（燥）復相（輔）也，成（歲）[3]而止。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:52',
            ),
            202 => 
            array (
                'id' => 203,
                'order' => '4',
                'article_id' => 4,
                'content' => '古（故）（歲）者，溼澡（燥）之所生也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:52',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            203 => 
            array (
                'id' => 204,
                'order' => '4',
                'article_id' => 4,
                'content' => '溼澡（燥）者，倉（凔）然（熱）之所生也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            204 => 
            array (
                'id' => 205,
                'order' => '4',
                'article_id' => 4,
                'content' => '倉（凔）然（熱）者。四時[4]者，（陰）昜（陽）之所生。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            205 => 
            array (
                'id' => 206,
                'order' => '5',
                'article_id' => 4,
                'content' => '（陰）昜（陽）者，神明之所生也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            206 => 
            array (
                'id' => 207,
                'order' => '5',
                'article_id' => 4,
                'content' => '神明者，天（地）之所生也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            207 => 
            array (
                'id' => 208,
                'order' => '5',
                'article_id' => 4,
                'content' => '天（地）[5]者，大（太）一之所生也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            208 => 
            array (
                'id' => 209,
                'order' => '6',
                'article_id' => 4,
                'content' => '是古（故）大（太）一（藏）於水，行於時，而或□□□□[6]（萬）勿（物）母。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            209 => 
            array (
                'id' => 210,
                'order' => '7',
                'article_id' => 4,
                'content' => '（一）块（缺）（一）浧（盈），以忌（紀）為（萬）勿（物）經。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            210 => 
            array (
                'id' => 211,
                'order' => '7',
                'article_id' => 4,
                'content' => '此天之所不能殺，（地）之所[7]不能釐，（陰）昜（陽）之所不能成。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            211 => 
            array (
                'id' => 212,
                'order' => '8',
                'article_id' => 4,
                'content' => '君子智（知）此之胃（謂）……[8]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            212 => 
            array (
                'id' => 213,
                'order' => '9',
                'article_id' => 4,
                'content' => '天道貴溺（弱），雀（爵）成者以益生者，伐於勥（強），責於……[9]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            213 => 
            array (
                'id' => 214,
                'order' => '10',
                'article_id' => 4,
                'content' => '下，土也，而胃（謂）之（地）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            214 => 
            array (
                'id' => 215,
                'order' => '10',
                'article_id' => 4,
                'content' => '上，（氣）也，而胃（謂）之天。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:53',
                'updated_at' => '2016-12-07 02:04:53',
            ),
            215 => 
            array (
                'id' => 216,
                'order' => '10',
                'article_id' => 4,
                'content' => '道亦其（字）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            216 => 
            array (
                'id' => 217,
                'order' => '10',
                'article_id' => 4,
                'content' => '青（請）昏（問）其名。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            217 => 
            array (
                'id' => 218,
                'order' => '10',
                'article_id' => 4,
                'content' => '以[10]道從事者必（託）其名，古（故）事成而身長。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            218 => 
            array (
                'id' => 219,
                'order' => '11',
                'article_id' => 4,
                'content' => '聖人之從事也，亦（託）其[11]名，古（故）（功）成而身不剔（傷）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            219 => 
            array (
                'id' => 220,
                'order' => '12',
                'article_id' => 4,
                'content' => '天（地）名（字）並立，古（故）（過）其方，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            220 => 
            array (
                'id' => 221,
                'order' => '12',
                'article_id' => 4,
                'content' => '不思相□□□□[12]於西北，其下高以勥（強）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            221 => 
            array (
                'id' => 222,
                'order' => '13',
                'article_id' => 4,
                'content' => '（地）不足於東南，其上□□□□□□□[13]者，又（有）余（餘）於下；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            222 => 
            array (
                'id' => 223,
                'order' => '14',
                'article_id' => 4,
                'content' => '不足於下者，又（有）余（餘）於上。[14]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            223 => 
            array (
                'id' => 224,
                'order' => '1',
                'article_id' => 5,
                'content' => '夫子曰：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:54',
            ),
            224 => 
            array (
                'id' => 225,
                'order' => '1',
                'article_id' => 5,
                'content' => '好（美）女（如）好茲（緇）衣，亞（惡）亞（惡）女（如）亞（惡）（巷）白（伯），則民（臧）（它？）而型（刑）不屯。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:54',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            225 => 
            array (
                'id' => 226,
                'order' => '1',
                'article_id' => 5,
                'content' => '《寺（詩）》[1]員（云）：「（儀）型（刑）文王，萬邦乍（作）孚。」■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            226 => 
            array (
                'id' => 227,
                'order' => '2',
                'article_id' => 5,
                'content' => '子曰：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            227 => 
            array (
                'id' => 228,
                'order' => '2',
                'article_id' => 5,
                'content' => '又（有）（國）者章好章亞（惡），以視民厚，則民[2]青（情）不（弋）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            228 => 
            array (
                'id' => 229,
                'order' => '3',
                'article_id' => 5,
                'content' => '《寺（詩）》員（云）：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            229 => 
            array (
                'id' => 230,
                'order' => '3',
                'article_id' => 5,
                'content' => '「情（靖）共尔立（位），好氏（是）貞（正）植（直）。」■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            230 => 
            array (
                'id' => 231,
                'order' => '3',
                'article_id' => 5,
                'content' => '為上可（望）而智（知）也，為下[3]可頪（述）而（志）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            231 => 
            array (
                'id' => 232,
                'order' => '4',
                'article_id' => 5,
                'content' => '則君不（疑）其臣，臣不惑於君。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            232 => 
            array (
                'id' => 233,
                'order' => '4',
                'article_id' => 5,
                'content' => '《寺（詩）》員（云）：「（淑）人君子，其義（儀）不[4]弋（忒）。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:55',
                'updated_at' => '2016-12-07 02:04:55',
            ),
            233 => 
            array (
                'id' => 234,
                'order' => '5',
                'article_id' => 5,
                'content' => '《尹（誥）》員（云）：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:56',
                'updated_at' => '2016-12-07 02:04:56',
            ),
            234 => 
            array (
                'id' => 235,
                'order' => '5',
                'article_id' => 5,
                'content' => '《尹（誥）》員（云）：「隹（惟）尹（伊）（尹）及湯，咸又（有）一惪（德）。」■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:56',
                'updated_at' => '2016-12-07 02:04:56',
            ),
            235 => 
            array (
                'id' => 236,
                'order' => '5',
                'article_id' => 5,
                'content' => '上人（疑）則百眚（姓）（惑），下難[5]智（知）則君倀（長）（勞）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:56',
                'updated_at' => '2016-12-07 02:04:56',
            ),
            236 => 
            array (
                'id' => 237,
                'order' => '6',
                'article_id' => 5,
                'content' => '古（故）君民者，章好以視民（欲），慬（謹）亞（惡）以民涇〈淫〉，則民不（惑）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:56',
                'updated_at' => '2016-12-07 02:04:56',
            ),
            237 => 
            array (
                'id' => 238,
                'order' => '6',
                'article_id' => 5,
                'content' => '臣事君，[6]言其所不能，不（詞）其所能，則君不（勞）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:56',
                'updated_at' => '2016-12-07 02:04:56',
            ),
            238 => 
            array (
                'id' => 239,
                'order' => '7',
                'article_id' => 5,
                'content' => '《大（雅）》員（云）：「上帝板板，下民卒担（疸）。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:04:56',
                'updated_at' => '2016-12-07 02:04:56',
            ),
            239 => 
            array (
                'id' => 240,
