                'updated_at' => '2016-12-07 02:05:28',
            ),
            110 => 
            array (
                'id' => 611,
                'order' => '27',
                'article_id' => 9,
                'content' => '大明不出，完勿（物）（皆）訇。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:28',
                'updated_at' => '2016-12-07 02:05:28',
            ),
            111 => 
            array (
                'id' => 612,
                'order' => '27',
                'article_id' => 9,
                'content' => '聖[27]者不才（在）上，天下壞，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:28',
                'updated_at' => '2016-12-07 02:05:28',
            ),
            112 => 
            array (
                'id' => 613,
                'order' => '28',
                'article_id' => 9,
                'content' => '（治）之，至（養）不喿；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:28',
                'updated_at' => '2016-12-07 02:05:28',
            ),
            113 => 
            array (
                'id' => 614,
                'order' => '28',
                'article_id' => 9,
                'content' => '亂之，至滅臤（賢）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            114 => 
            array (
                'id' => 615,
                'order' => '28',
                'article_id' => 9,
                'content' => '（仁）者為此進[28]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            115 => 
            array (
                'id' => 616,
                'order' => '29',
                'article_id' => 9,
                'content' => '女（如）此也。[29]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            116 => 
            array (
                'id' => 617,
                'order' => '1',
                'article_id' => 10,
                'content' => '不不，忠之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            117 => 
            array (
                'id' => 618,
                'order' => '1',
                'article_id' => 10,
                'content' => '不惎弗智（知），信之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            118 => 
            array (
                'id' => 619,
                'order' => '1',
                'article_id' => 10,
                'content' => '忠（積）則可（親）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            119 => 
            array (
                'id' => 620,
                'order' => '1',
                'article_id' => 10,
                'content' => '信（積）則可信也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            120 => 
            array (
                'id' => 621,
                'order' => '1',
                'article_id' => 10,
                'content' => '忠[1]信（積）而民弗（親）信者，未之又（有）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            121 => 
            array (
                'id' => 622,
                'order' => '2',
                'article_id' => 10,
                'content' => '至忠女（如）土，蟡（為）勿（物）而不（發）；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            122 => 
            array (
                'id' => 623,
                'order' => '2',
                'article_id' => 10,
                'content' => '至信女（如）（時），至而不結。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            123 => 
            array (
                'id' => 624,
                'order' => '2',
                'article_id' => 10,
                'content' => '忠人亡[2]，信人不伓（背）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            124 => 
            array (
                'id' => 625,
                'order' => '3',
                'article_id' => 10,
                'content' => '君子女（如）此，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            125 => 
            array (
                'id' => 626,
                'order' => '3',
                'article_id' => 10,
                'content' => '古（故）不生，不伓（背）死也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:29',
                'updated_at' => '2016-12-07 02:05:29',
            ),
            126 => 
            array (
                'id' => 627,
                'order' => '3',
                'article_id' => 10,
                'content' => '大舊而不俞（渝），忠之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            127 => 
            array (
                'id' => 628,
                'order' => '3',
                'article_id' => 10,
                'content' => '匋而者尚，信[3]之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            128 => 
            array (
                'id' => 629,
                'order' => '4',
                'article_id' => 10,
                'content' => '至忠亡，至信不伓（背），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            129 => 
            array (
                'id' => 630,
                'order' => '4',
                'article_id' => 10,
                'content' => '夫此之胃（謂）此。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            130 => 
            array (
                'id' => 631,
                'order' => '4',
                'article_id' => 10,
                'content' => '大忠不兌（奪），大信不（期）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            131 => 
            array (
                'id' => 632,
                'order' => '4',
                'article_id' => 10,
                'content' => '不兌（奪）而足（養）者，（地）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            132 => 
            array (
                'id' => 633,
                'order' => '4',
                'article_id' => 10,
                'content' => '不（期）[4]而可者，天也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            133 => 
            array (
                'id' => 634,
                'order' => '5',
                'article_id' => 10,
                'content' => '（節）天墜（地）也者，忠信之胃（謂）此。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:30',
                'updated_at' => '2016-12-07 02:05:30',
            ),
            134 => 
            array (
                'id' => 635,
                'order' => '5',
                'article_id' => 10,
                'content' => '口而實弗从（從），君子弗言尔。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            135 => 
            array (
                'id' => 636,
                'order' => '5',
                'article_id' => 10,
                'content' => '心□□□[5]（親），君子弗申尔。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            136 => 
            array (
                'id' => 637,
                'order' => '6',
                'article_id' => 10,
                'content' => '古（故）行而鯖兌民，君子弗（由）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            137 => 
            array (
                'id' => 638,
                'order' => '6',
                'article_id' => 10,
                'content' => '三者，忠人弗乍（作），信人弗為也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            138 => 
            array (
                'id' => 639,
                'order' => '6',
                'article_id' => 10,
                'content' => '忠之為[6]（道）也，百工不古，而人（養）（皆）足。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            139 => 
            array (
                'id' => 640,
                'order' => '7',
                'article_id' => 10,
                'content' => '信之為（道）也，群勿（物）皆成，而百善（皆）立。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            140 => 
            array (
                'id' => 641,
                'order' => '7',
                'article_id' => 10,
                'content' => '君子其它（施）也[7]忠，古（故）（）（親）尃（傅）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            141 => 
            array (
                'id' => 642,
                'order' => '8',
                'article_id' => 10,
                'content' => '其言尔信，古（故）而可受也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            142 => 
            array (
                'id' => 643,
                'order' => '8',
                'article_id' => 10,
                'content' => '忠，（仁）之實也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            143 => 
            array (
                'id' => 644,
                'order' => '8',
                'article_id' => 10,
                'content' => '信，（義）之（期）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            144 => 
            array (
                'id' => 645,
                'order' => '8',
                'article_id' => 10,
                'content' => '氏（是）古（故）古之所[8]以行虖（乎）嘍者，女（如）此也。[9]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:31',
            ),
            145 => 
            array (
                'id' => 646,
                'order' => '1',
                'article_id' => 11,
                'content' => '成之（聞）之曰：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:31',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            146 => 
            array (
                'id' => 647,
                'order' => '1',
                'article_id' => 11,
                'content' => '古之甬（用）民者，求之於（己）為亙（恆）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            147 => 
            array (
                'id' => 648,
                'order' => '1',
                'article_id' => 11,
                'content' => '行不信則命不從，[1]信不（著）則言不樂。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            148 => 
            array (
                'id' => 649,
                'order' => '2',
                'article_id' => 11,
                'content' => '民不從上之命，不信其言，而能（含）惪（德）者，未之[2]又（有）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            149 => 
            array (
                'id' => 650,
                'order' => '3',
                'article_id' => 11,
                'content' => '古（故）君子之立民也，身備（服）善以先之，敬（慎）以之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            150 => 
            array (
                'id' => 651,
                'order' => '3',
                'article_id' => 11,
                'content' => '其所才（在）者內（矣）。[3]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            151 => 
            array (
                'id' => 652,
                'order' => '4',
                'article_id' => 11,
                'content' => '君子之於（教）也，其道民也不，則其也弗深（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            152 => 
            array (
                'id' => 653,
                'order' => '4',
                'article_id' => 11,
                'content' => '是古（故）亡（乎）其身而[4]（乎）其（詞），唯（雖）（厚）其命，民弗從之（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:32',
                'updated_at' => '2016-12-07 02:05:32',
            ),
            153 => 
            array (
                'id' => 654,
                'order' => '5',
                'article_id' => 11,
                'content' => '是古（故）畏備（服）型（刑）罰之婁（屢）行也，[5]（由）（上）之弗身也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            154 => 
            array (
                'id' => 655,
                'order' => '6',
                'article_id' => 11,
                'content' => '昔者君子有言曰：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            155 => 
            array (
                'id' => 656,
                'order' => '6',
                'article_id' => 11,
                'content' => '戰與型（刑）人，君子之述惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            156 => 
            array (
                'id' => 657,
                'order' => '6',
                'article_id' => 11,
                'content' => '是古（故）[6]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            157 => 
            array (
                'id' => 658,
                'order' => '7',
                'article_id' => 11,
                'content' => '（上）句（苟）身備（服）之，則民必有甚安（焉）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            158 => 
            array (
                'id' => 659,
                'order' => '7',
                'article_id' => 11,
                'content' => '君均而立於（祚），一宮之人不（勝）[7]其敬。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            159 => 
            array (
                'id' => 660,
                'order' => '8',
                'article_id' => 11,
                'content' => '君衰而処立，一宮之人不（勝）……[8]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            160 => 
            array (
                'id' => 661,
                'order' => '9',
                'article_id' => 11,
                'content' => '一軍之人不（勝）其（勇）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:33',
                'updated_at' => '2016-12-07 02:05:33',
            ),
            161 => 
            array (
                'id' => 662,
                'order' => '9',
                'article_id' => 11,
                'content' => '（上）句（苟）昌之，則民鮮不從（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:34',
                'updated_at' => '2016-12-07 02:05:34',
            ),
            162 => 
            array (
                'id' => 663,
                'order' => '9',
                'article_id' => 11,
                'content' => '唯（雖）肰（然），其也不（厚），[9]其重也弗多（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:34',
                'updated_at' => '2016-12-07 02:05:34',
            ),
            163 => 
