                'updated_at' => '2016-12-07 02:05:35',
            ),
            175 => 
            array (
                'id' => 676,
                'order' => '16',
                'article_id' => 11,
                'content' => '古（故）君子不貴（庶）勿（物）而貴與[16]民又（有）同也。',
