                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            223 => 
            array (
                'id' => 724,
                'order' => '37',
                'article_id' => 11,
                'content' => '昔者君子有言曰「聖人天惪（德）」害（曷）？[37]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            224 => 
            array (
                'id' => 725,
                'order' => '38',
                'article_id' => 11,
                'content' => '言（慎）求之於（己），而可以至川（順）天（常）（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            225 => 
            array (
                'id' => 726,
                'order' => '38',
                'article_id' => 11,
                'content' => '《康（誥）》曰「不還大暊，文王（作）罰，[38]型（刑）（茲）亡」害（曷）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            226 => 
            array (
                'id' => 727,
                'order' => '39',
                'article_id' => 11,
                'content' => '此言也，言不大（常）者，文王之型（刑）莫厚安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            227 => 
            array (
                'id' => 728,
                'order' => '39',
                'article_id' => 11,
                'content' => '是[39]古（故）君子（慎）六立以巳（祀）天（常）。[40]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            228 => 
            array (
                'id' => 729,
                'order' => '1',
                'article_id' => 12,
                'content' => '惪（德）義，明（乎）民侖（倫），可以為君。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            229 => 
            array (
                'id' => 730,
                'order' => '1',
                'article_id' => 12,
                'content' => '忿（），改（勝），為人上者之（務）也。[1]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            230 => 
            array (
                'id' => 731,
                'order' => '2',
                'article_id' => 12,
                'content' => '賞與坓（刑），（禍）福之也，或前之者矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            231 => 
            array (
                'id' => 732,
                'order' => '2',
                'article_id' => 12,
                'content' => '雀（爵）立（位），所以信其肰（然）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:39',
            ),
            232 => 
            array (
                'id' => 733,
                'order' => '2',
                'article_id' => 12,
                'content' => '正欽，所以[2]（攻）□□。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:39',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            233 => 
            array (
                'id' => 734,
                'order' => '3',
                'article_id' => 12,
                'content' => '坓（刑）□，所以□（舉）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            234 => 
            array (
                'id' => 735,
                'order' => '3',
                'article_id' => 12,
                'content' => '殺（戮），所以敘（除）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            235 => 
            array (
                'id' => 736,
                'order' => '3',
                'article_id' => 12,
                'content' => '不（由）其道，不行。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            236 => 
            array (
                'id' => 737,
                'order' => '3',
                'article_id' => 12,
                'content' => '（仁）為可新（親）[3]也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            237 => 
            array (
                'id' => 738,
                'order' => '4',
                'article_id' => 12,
                'content' => '義為可也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            238 => 
            array (
                'id' => 739,
                'order' => '4',
                'article_id' => 12,
                'content' => '忠為可信也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            239 => 
            array (
                'id' => 740,
                'order' => '4',
                'article_id' => 12,
                'content' => '學為可益也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            240 => 
            array (
                'id' => 741,
                'order' => '4',
                'article_id' => 12,
                'content' => '（教）為可頪（類）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            241 => 
            array (
                'id' => 742,
                'order' => '4',
                'article_id' => 12,
                'content' => '（教）非改道也，（教）之也。[4]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            242 => 
            array (
                'id' => 743,
                'order' => '4',
                'article_id' => 12,
                'content' => '學非改侖（倫）也，學（己）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:40',
            ),
            243 => 
            array (
                'id' => 744,
                'order' => '5',
                'article_id' => 12,
                'content' => '（禹）以人道（治）其民，桀以人道亂其民。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:40',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            244 => 
            array (
                'id' => 745,
                'order' => '5',
                'article_id' => 12,
                'content' => '桀不易[5]（禹）民而句（後）亂之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            245 => 
            array (
                'id' => 746,
                'order' => '6',
                'article_id' => 12,
                'content' => '湯不易桀民而句（後）（治）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            246 => 
            array (
                'id' => 747,
                'order' => '6',
                'article_id' => 12,
                'content' => '聖人之（治）民，民之道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            247 => 
            array (
                'id' => 748,
                'order' => '6',
                'article_id' => 12,
                'content' => '（禹）[6]之行水，水之道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            248 => 
            array (
                'id' => 749,
                'order' => '7',
                'article_id' => 12,
                'content' => '戚（造）父之（御）馬，馬也之道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            249 => 
            array (
                'id' => 750,
                'order' => '7',
                'article_id' => 12,
                'content' => '句（后）（禝）之埶（藝）（地），（地）之道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            250 => 
            array (
                'id' => 751,
                'order' => '7',
                'article_id' => 12,
                'content' => '莫[7]不又（有）道安（焉），人道為近。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            251 => 
            array (
                'id' => 752,
                'order' => '8',
                'article_id' => 12,
                'content' => '是以君子人道之取先。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            252 => 
            array (
                'id' => 753,
                'order' => '8',
                'article_id' => 12,
                'content' => '者出所以智（知）[8]（己），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            253 => 
            array (
                'id' => 754,
                'order' => '8',
                'article_id' => 12,
                'content' => '智（知）（己）所以智（知）人，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            254 => 
            array (
                'id' => 755,
                'order' => '9',
                'article_id' => 12,
                'content' => '智（知）人所以智（知）命，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            255 => 
            array (
                'id' => 756,
                'order' => '9',
                'article_id' => 12,
                'content' => '智（知）命而句（後）智（知）道，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:41',
            ),
            256 => 
            array (
                'id' => 757,
                'order' => '9',
                'article_id' => 12,
                'content' => '智（知）道而句（後）智（知）行。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:41',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            257 => 
            array (
                'id' => 758,
                'order' => '9',
                'article_id' => 12,
                'content' => '（由）豊（禮）智（知）[9]樂，（由）樂智（知）（哀）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            258 => 
            array (
                'id' => 759,
                'order' => '10',
                'article_id' => 12,
                'content' => '又（有）智（知）（己）而不智（知）命者，亡智（知）命而不智（知）（己）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            259 => 
            array (
                'id' => 760,
                'order' => '10',
                'article_id' => 12,
                'content' => '又（有）[10]智（知）豊（禮）而不智（知）樂者，亡智（知）樂而不智（知）豊（禮）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            260 => 
            array (
                'id' => 761,
                'order' => '11',
                'article_id' => 12,
                'content' => '善取人能從之，上也。[11]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            261 => 
            array (
                'id' => 762,
                'order' => '12',
                'article_id' => 12,
                'content' => '善者民必眾，眾未必（治），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            262 => 
            array (
                'id' => 763,
                'order' => '12',
                'article_id' => 12,
                'content' => '不（治）不川（順），不川（順）不坪（平）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            263 => 
            array (
                'id' => 764,
                'order' => '12',
                'article_id' => 12,
                'content' => '是以為正（政）者（教）道[12]之取先。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            264 => 
            array (
                'id' => 765,
                'order' => '13',
                'article_id' => 12,
                'content' => '（教）以豊（禮），則民果以巠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            265 => 
            array (
                'id' => 766,
                'order' => '13',
                'article_id' => 12,
                'content' => '（教）以樂，則民惪（德）清。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            266 => 
            array (
                'id' => 767,
                'order' => '13',
                'article_id' => 12,
                'content' => '（教）[13]以（辯）兌（說），則民埶貴以忘。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            267 => 
            array (
                'id' => 768,
                'order' => '14',
                'article_id' => 12,
                'content' => '（教）以埶（藝），則民埜（野）以靜（爭）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            268 => 
            array (
                'id' => 769,
                'order' => '14',
                'article_id' => 12,
                'content' => '（教）以[14]則民少以（吝）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:42',
            ),
            269 => 
            array (
                'id' => 770,
                'order' => '15',
                'article_id' => 12,
                'content' => '（教）以言，則民（訏）以（寡）信。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:42',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            270 => 
            array (
                'id' => 771,
                'order' => '15',
                'article_id' => 12,
                'content' => '（教）以事，則民力（嗇）以面利。[15]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            271 => 
            array (
                'id' => 772,
                'order' => '16',
                'article_id' => 12,
                'content' => '（教）以懽（權）（謀），則民湯（？）遠豊（禮）亡新（親）（仁）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            272 => 
            array (
                'id' => 773,
                'order' => '16',
                'article_id' => 12,
                'content' => '先以惪（德），則民進善安（焉）。[16]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            273 => 
            array (
                'id' => 774,
                'order' => '17',
                'article_id' => 12,
                'content' => '行此也，然句（後）可逾（？）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            274 => 
            array (
                'id' => 775,
                'order' => '17',
                'article_id' => 12,
                'content' => '因亙（恆）則古（固），則亡避，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            275 => 
            array (
                'id' => 776,
                'order' => '17',
                'article_id' => 12,
                'content' => '不（黨）則亡[17]（怨），思則□□。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            276 => 
            array (
                'id' => 777,
                'order' => '18',
                'article_id' => 12,
                'content' => '夫生而又（有）戠（職）事者也，非（教）所及也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            277 => 
            array (
                'id' => 778,
                'order' => '18',
                'article_id' => 12,
                'content' => '（教）其正（政），[18]不（教）其人，正（政）弗行矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            278 => 
            array (
                'id' => 779,
                'order' => '19',
                'article_id' => 12,
                'content' => '古（故）（終？）是勿（物）也而又深安（焉）者，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            279 => 
            array (
                'id' => 780,
                'order' => '19',
                'article_id' => 12,
                'content' => '可學也而不可矣（疑）也，[19]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            280 => 
            array (
                'id' => 781,
                'order' => '20',
                'article_id' => 12,
                'content' => '可（教）也而不可迪其民，而民不可（止）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            281 => 
            array (
                'id' => 782,
                'order' => '20',
                'article_id' => 12,
                'content' => '（仁）、新（親）忠、敬壯、（歸）豊（禮），[20]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:43',
            ),
            282 => 
            array (
                'id' => 783,
                'order' => '21',
                'article_id' => 12,
                'content' => '行矣而亡，羕心於子俍，忠信日益而不自智（知）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:43',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            283 => 
            array (
                'id' => 784,
                'order' => '21',
                'article_id' => 12,
                'content' => '民可（使）道[21]之，而不可（使）智（知）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            284 => 
            array (
                'id' => 785,
                'order' => '22',
                'article_id' => 12,
                'content' => '民可道也，而不可勥（強）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            285 => 
            array (
                'id' => 786,
                'order' => '22',
                'article_id' => 12,
                'content' => '桀不胃（謂）其民必亂，而民又（有）[22]為亂矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            286 => 
            array (
                'id' => 787,
                'order' => '23',
                'article_id' => 12,
                'content' => '爰（？）不若也，可從也而不可及也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            287 => 
            array (
                'id' => 788,
                'order' => '23',
                'article_id' => 12,
                'content' => '君民者，（治）民復豊（禮），民余智[23]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            288 => 
            array (
                'id' => 789,
                'order' => '24',
                'article_id' => 12,
                'content' => '（勞）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            289 => 
            array (
                'id' => 790,
                'order' => '24',
                'article_id' => 12,
                'content' => '為邦而不以豊（禮），猷（猶）之亡也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            290 => 
            array (
                'id' => 791,
                'order' => '24',
                'article_id' => 12,
                'content' => '非豊（禮）而民兌（悅）[24]此少（小）人矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            291 => 
            array (
                'id' => 792,
                'order' => '25',
                'article_id' => 12,
                'content' => '非侖（倫）而民備（服），殜（世？）此亂矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            292 => 
            array (
                'id' => 793,
                'order' => '25',
                'article_id' => 12,
                'content' => '（治）民非還生而已也，[25]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            293 => 
            array (
                'id' => 794,
                'order' => '26',
                'article_id' => 12,
                'content' => '不以旨谷（欲）其義。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:44',
                'updated_at' => '2016-12-07 02:05:44',
            ),
            294 => 
            array (
                'id' => 795,
                'order' => '26',
                'article_id' => 12,
                'content' => '民（愛），則子也；弗（愛），則也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            295 => 
            array (
                'id' => 796,
                'order' => '26',
                'article_id' => 12,
                'content' => '民五之方各，[26]十之方靜，百之而句（後）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            296 => 
            array (
                'id' => 797,
                'order' => '27',
                'article_id' => 12,
                'content' => '善者民必福，福未必和，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            297 => 
            array (
                'id' => 798,
                'order' => '27',
                'article_id' => 12,
                'content' => '不和不安，不安不樂。[27]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            298 => 
            array (
                'id' => 799,
                'order' => '28',
                'article_id' => 12,
                'content' => '為古（故）（率）民向方者，唯惪（德）可。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            299 => 
            array (
                'id' => 800,
                'order' => '28',
                'article_id' => 12,
                'content' => '惪（德）之流，速（乎）而（傳）[28]命。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            300 => 
            array (
                'id' => 801,
                'order' => '29',
                'article_id' => 12,
                'content' => '其載也亡厚安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            301 => 
            array (
                'id' => 802,
                'order' => '29',
                'article_id' => 12,
                'content' => '交矣而弗智（知）也，亡。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:45',
                'updated_at' => '2016-12-07 02:05:45',
            ),
            302 => 
            array (
                'id' => 803,
                'order' => '29',
                'article_id' => 12,
                'content' => '惪（德）者，（且）莫大（乎）豊（禮）樂。[29]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            303 => 
            array (
                'id' => 804,
                'order' => '30',
                'article_id' => 12,
                'content' => '古（故）為正（政）者，或侖（論）之，或羕之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            304 => 
            array (
                'id' => 805,
                'order' => '30',
                'article_id' => 12,
                'content' => '或（由）（中）出，或埶（設）之外，侖隶其頪（類）[30]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            305 => 
            array (
                'id' => 806,
                'order' => '31',
                'article_id' => 12,
                'content' => '安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            306 => 
            array (
                'id' => 807,
                'order' => '31',
                'article_id' => 12,
                'content' => '（治）樂和（哀），民不可或（惑）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            307 => 
            array (
                'id' => 808,
                'order' => '31',
                'article_id' => 12,
                'content' => '反之，此往矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            308 => 
            array (
                'id' => 809,
                'order' => '31',
                'article_id' => 12,
                'content' => '坓（刑）不隶於君子，豊（禮）不[31]隶於小人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            309 => 
            array (
                'id' => 810,
                'order' => '32',
                'article_id' => 12,
                'content' => '攻□往者復。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            310 => 
            array (
                'id' => 811,
                'order' => '32',
                'article_id' => 12,
                'content' => '依惠則民材足，不時則亡懽也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            311 => 
            array (
                'id' => 812,
                'order' => '32',
                'article_id' => 12,
                'content' => '不[32]（愛）則不新（親），不□則弗，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            312 => 
            array (
                'id' => 813,
                'order' => '33',
                'article_id' => 12,
                'content' => '不釐則亡愄（畏），不忠則不信，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            313 => 
            array (
                'id' => 814,
                'order' => '33',
                'article_id' => 12,
                'content' => '弗恿則[33]亡復。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:46',
            ),
            314 => 
            array (
                'id' => 815,
                'order' => '34',
                'article_id' => 12,
                'content' => '則民，正則民不（吝），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:46',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            315 => 
            array (
                'id' => 816,
                'order' => '34',
                'article_id' => 12,
                'content' => '則民不。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            316 => 
            array (
                'id' => 817,
                'order' => '34',
                'article_id' => 12,
                'content' => '（均）不足以坪（平）正（政），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            317 => 
            array (
                'id' => 818,
                'order' => '34',
                'article_id' => 12,
                'content' => '（？）[34]不足以安民，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            318 => 
            array (
                'id' => 819,
                'order' => '35',
                'article_id' => 12,
                'content' => '（勇）不足以沫眾，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            319 => 
            array (
                'id' => 820,
                'order' => '35',
                'article_id' => 12,
                'content' => '尃（博）不足以智（知）善，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            320 => 
            array (
                'id' => 821,
                'order' => '35',
                'article_id' => 12,
                'content' => '快不足以智（知）侖（倫），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            321 => 
            array (
                'id' => 822,
                'order' => '35',
                'article_id' => 12,
                'content' => '殺[35]不足以（）民。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            322 => 
            array (
                'id' => 823,
                'order' => '36',
                'article_id' => 12,
                'content' => '下之事上也，不從其所命，而從其所行。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            323 => 
            array (
                'id' => 824,
                'order' => '36',
                'article_id' => 12,
                'content' => '上好是勿（物）也，[36]下必又（有）甚安（焉）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            324 => 
            array (
                'id' => 825,
                'order' => '37',
                'article_id' => 12,
                'content' => '夫唯是，古（故）惪（德）可易而（施）可也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            325 => 
            array (
                'id' => 826,
                'order' => '37',
                'article_id' => 12,
                'content' => '又（有）是（施）少（小）[37]又（有）利，而大又（有）（害）者，又（有）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            326 => 
            array (
                'id' => 827,
                'order' => '38',
                'article_id' => 12,
                'content' => '又（有）是（施）少（小）又（有）（害），而大又（有）利者，又（有）之。[38]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:47',
            ),
            327 => 
            array (
                'id' => 828,
                'order' => '39',
                'article_id' => 12,
                'content' => '凡（動）民必訓（順）民心，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:47',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            328 => 
            array (
                'id' => 829,
                'order' => '39',
                'article_id' => 12,
                'content' => '民心又（有）恆，求其羕，童（重）義（集）釐（理），言此章也。[39]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            329 => 
            array (
                'id' => 830,
                'order' => '1',
                'article_id' => 13,
                'content' => '凡人唯（雖）又（有）眚（性），心亡奠志，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            330 => 
            array (
                'id' => 831,
                'order' => '1',
                'article_id' => 13,
                'content' => '（待）勿（物）而句（後）（作），（待）兌（悅）而句（後）行，（待）習而句（後）[1]奠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            331 => 
            array (
                'id' => 832,
                'order' => '2',
                'article_id' => 13,
                'content' => '（喜）（怒）（哀）悲之（氣），眚（性）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            332 => 
            array (
                'id' => 833,
                'order' => '2',
                'article_id' => 13,
                'content' => '及其見於外，則勿（物）取之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            333 => 
            array (
                'id' => 834,
                'order' => '2',
                'article_id' => 13,
                'content' => '眚（性）自命出，命[2]自天降。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            334 => 
            array (
                'id' => 835,
                'order' => '3',
                'article_id' => 13,
                'content' => '（道）司（始）於青（情），青（情）生於眚（性）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            335 => 
            array (
                'id' => 836,
                'order' => '3',
                'article_id' => 13,
                'content' => '司（始）者近青（情），終者近義。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            336 => 
            array (
                'id' => 837,
                'order' => '3',
                'article_id' => 13,
                'content' => '智□□□[3]出之，智（知）宜（義）者能內（納）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            337 => 
            array (
                'id' => 838,
                'order' => '4',
                'article_id' => 13,
                'content' => '好亞（惡），眚（性）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:48',
                'updated_at' => '2016-12-07 02:05:48',
            ),
            338 => 
            array (
                'id' => 839,
                'order' => '4',
                'article_id' => 13,
                'content' => '所好所亞（惡），勿（物）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            339 => 
            array (
                'id' => 840,
                'order' => '4',
                'article_id' => 13,
                'content' => '善不□□□，[4]所善所不善，埶（勢）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            340 => 
            array (
                'id' => 841,
                'order' => '5',
                'article_id' => 13,
                'content' => '凡眚（性）為宔（主），勿（物）取之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            341 => 
            array (
                'id' => 842,
                'order' => '5',
                'article_id' => 13,
                'content' => '金石之又（有）聖（聲），□□□[5]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            342 => 
            array (
                'id' => 843,
                'order' => '6',
                'article_id' => 13,
                'content' => '□□□唯（雖）又（有）眚（性）心弗取不出。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            343 => 
            array (
                'id' => 844,
                'order' => '6',
                'article_id' => 13,
                'content' => '凡心又（有）志也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            344 => 
            array (
                'id' => 845,
                'order' => '6',
                'article_id' => 13,
                'content' => '亡与不□□□□□[6]蜀（獨）行，猷（猶）口之不可蜀（獨）言也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:49',
            ),
            345 => 
            array (
                'id' => 846,
                'order' => '7',
                'article_id' => 13,
                'content' => '牛生而倀（長），生而（伸），其眚（性）……[7]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:49',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            346 => 
            array (
                'id' => 847,
                'order' => '8',
                'article_id' => 13,
                'content' => '而學或（使）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            347 => 
            array (
                'id' => 848,
                'order' => '8',
                'article_id' => 13,
                'content' => '凡勿（物）亡不異也者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            348 => 
            array (
                'id' => 849,
                'order' => '8',
                'article_id' => 13,
                'content' => '剛之梪也，剛取之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            349 => 
            array (
                'id' => 850,
                'order' => '8',
                'article_id' => 13,
                'content' => '柔之[8]約，柔取之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            350 => 
            array (
                'id' => 851,
                'order' => '9',
                'article_id' => 13,
                'content' => '四（海）之內其眚（性）弌（一）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            351 => 
            array (
                'id' => 852,
                'order' => '9',
                'article_id' => 13,
                'content' => '其甬（用）心各異，（教）（使）肰（然）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            352 => 
            array (
                'id' => 853,
                'order' => '9',
                'article_id' => 13,
                'content' => '凡眚（性）[9]或（動）之，或（逢？）之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            353 => 
            array (
                'id' => 854,
                'order' => '10',
                'article_id' => 13,
                'content' => '或交之，或萬（厲）之，或出之，或羕（養）之，或長之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            354 => 
            array (
                'id' => 855,
                'order' => '10',
                'article_id' => 13,
                'content' => '凡（動）眚（性）[10]者，勿（物）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            355 => 
            array (
                'id' => 856,
                'order' => '11',
                'article_id' => 13,
                'content' => '（逢？）眚（性）者，兌（悅）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            356 => 
            array (
                'id' => 857,
                'order' => '11',
                'article_id' => 13,
                'content' => '交眚（性）者，古（故）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            357 => 
            array (
                'id' => 858,
                'order' => '11',
                'article_id' => 13,
                'content' => '萬（厲）眚（性）者，宜（義）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:50',
                'updated_at' => '2016-12-07 02:05:50',
            ),
            358 => 
            array (
                'id' => 859,
                'order' => '11',
                'article_id' => 13,
                'content' => '出眚（性）者，埶（勢）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            359 => 
            array (
                'id' => 860,
                'order' => '11',
                'article_id' => 13,
                'content' => '羕（養）眚（性）[11]者，習也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            360 => 
            array (
                'id' => 861,
                'order' => '12',
                'article_id' => 13,
                'content' => '長眚（性）者，（道）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            361 => 
            array (
                'id' => 862,
                'order' => '12',
                'article_id' => 13,
                'content' => '凡見者之胃（謂）勿（物），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            362 => 
            array (
                'id' => 863,
                'order' => '12',
                'article_id' => 13,
                'content' => '快於（己）者之胃（謂）兌（悅），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            363 => 
            array (
                'id' => 864,
                'order' => '12',
                'article_id' => 13,
                'content' => '勿（物）[12]之埶（勢）者之胃（謂）埶（勢），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            364 => 
            array (
                'id' => 865,
                'order' => '13',
                'article_id' => 13,
                'content' => '又（有）為也者之胃（謂）古（故）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            365 => 
            array (
                'id' => 866,
                'order' => '13',
                'article_id' => 13,
                'content' => '義也者，群善之（蕝）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            366 => 
            array (
                'id' => 867,
                'order' => '13',
                'article_id' => 13,
                'content' => '習也[13]者，又（有）以習其眚（性）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            367 => 
            array (
                'id' => 868,
                'order' => '14',
                'article_id' => 13,
                'content' => '（道）者，群勿（物）之（道）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            368 => 
            array (
                'id' => 869,
                'order' => '14',
                'article_id' => 13,
                'content' => '凡（道），心述（術）為宔（主）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            369 => 
            array (
                'id' => 870,
                'order' => '14',
                'article_id' => 13,
                'content' => '（道）四述（術），唯[14]人（道）為可（道）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            370 => 
            array (
                'id' => 871,
                'order' => '15',
                'article_id' => 13,
                'content' => '其參（三）述（術）者，（道）之而已。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            371 => 
            array (
                'id' => 872,
                'order' => '15',
                'article_id' => 13,
                'content' => '時（詩）、箸（書）、豊（禮）、樂，其司（始）出皆生[15]於人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:51',
                'updated_at' => '2016-12-07 02:05:51',
            ),
            372 => 
            array (
                'id' => 873,
                'order' => '16',
                'article_id' => 13,
                'content' => '時（詩），又（有）為為之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            373 => 
            array (
                'id' => 874,
                'order' => '16',
                'article_id' => 13,
                'content' => '箸（書），又（有）為言之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            374 => 
            array (
                'id' => 875,
                'order' => '16',
                'article_id' => 13,
                'content' => '豊（禮）、樂，又（有）為（舉）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            375 => 
            array (
                'id' => 876,
                'order' => '16',
                'article_id' => 13,
                'content' => '聖人比其[16]頪（類）而侖（論）會之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            376 => 
            array (
                'id' => 877,
                'order' => '17',
                'article_id' => 13,
                'content' => '（觀）其之而訓之，體其宜（義）而即之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            377 => 
            array (
                'id' => 878,
                'order' => '17',
                'article_id' => 13,
                'content' => '里（理）[17]其青（情）而出內（入）之，肰（然）句（後）復以（教）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            378 => 
            array (
                'id' => 879,
                'order' => '18',
                'article_id' => 13,
                'content' => '（教），所以生惪（德）于（中）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            379 => 
            array (
                'id' => 880,
                'order' => '18',
                'article_id' => 13,
                'content' => '豊（禮）（作）於青（情），[18]或之也，堂（當）事因方而折（制）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            380 => 
            array (
                'id' => 881,
                'order' => '19',
                'article_id' => 13,
                'content' => '其先後之舍則宜（義）道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:52',
            ),
            381 => 
            array (
                'id' => 882,
                'order' => '19',
                'article_id' => 13,
                'content' => '或舍為[19]之即則也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:52',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            382 => 
            array (
                'id' => 883,
                'order' => '20',
                'article_id' => 13,
                'content' => '至頌（廟），所以即也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            383 => 
            array (
                'id' => 884,
                'order' => '20',
                'article_id' => 13,
                'content' => '君子（美）其青（情），□□□，[20]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            384 => 
            array (
                'id' => 885,
                'order' => '21',
                'article_id' => 13,
                'content' => '善其即，好其頌，樂其（道），兌（悅）其（教），是以敬安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            385 => 
            array (
                'id' => 886,
                'order' => '21',
                'article_id' => 13,
                'content' => '拜，所以□□□[21]其也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            386 => 
            array (
                'id' => 887,
                'order' => '22',
                'article_id' => 13,
                'content' => '幣帛，所以為信與（證）也，其（詞）宜（義）道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            387 => 
            array (
                'id' => 888,
                'order' => '22',
                'article_id' => 13,
                'content' => '（笑），（禮）之也。[22]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            388 => 
            array (
                'id' => 889,
                'order' => '23',
                'article_id' => 13,
                'content' => '樂，（禮）之深澤也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            389 => 
            array (
                'id' => 890,
                'order' => '23',
                'article_id' => 13,
                'content' => '凡聖（聲），其出於情也信，肰（然）句（然）其內（入）拔人之心也。[23]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            390 => 
            array (
                'id' => 891,
                'order' => '24',
                'article_id' => 13,
                'content' => '（聞）（笑）聖（聲），則羴（鮮）女（如）也斯（喜）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            391 => 
            array (
                'id' => 892,
                'order' => '24',
                'article_id' => 13,
                'content' => '昏（聞）訶（歌）（謠），則舀女（如）也斯奮。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:53',
            ),
            392 => 
            array (
                'id' => 893,
                'order' => '24',
                'article_id' => 13,
                'content' => '聖（聽）（琴）（瑟）之聖（聲），[24]則女（如）也斯戁（難）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:53',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            393 => 
            array (
                'id' => 894,
                'order' => '24',
                'article_id' => 13,
                'content' => '聖（聽）（琴）（瑟）之聖（聲），[24]則女（如）也斯戁（難）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            394 => 
            array (
                'id' => 895,
                'order' => '25',
                'article_id' => 13,
                'content' => '（觀）（賚）武，則齊女（如）也斯（作）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            395 => 
            array (
                'id' => 896,
                'order' => '25',
                'article_id' => 13,
                'content' => '（觀）卲（韶）（夏），則免（勉）女（如）也[25]斯僉（儉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            396 => 
            array (
                'id' => 897,
                'order' => '26',
                'article_id' => 13,
                'content' => '羕思而勭（動）心，女（如）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            397 => 
            array (
                'id' => 898,
                'order' => '26',
                'article_id' => 13,
                'content' => '其居即（次）也舊，其反善復（始）也[26]（慎），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            398 => 
            array (
                'id' => 899,
                'order' => '27',
                'article_id' => 13,
                'content' => '其出內（入）也訓（順），司其惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            399 => 
            array (
                'id' => 900,
                'order' => '27',
                'article_id' => 13,
                'content' => '奠（鄭）（衛）之樂，則非其聖（聽）而從之也。[27]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            400 => 
            array (
                'id' => 901,
                'order' => '28',
                'article_id' => 13,
                'content' => '凡古樂龍心，益樂龍指，皆（教）其人者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            401 => 
            array (
                'id' => 902,
                'order' => '28',
                'article_id' => 13,
                'content' => '（賚）武樂取，佋（韶）（夏）樂情。[28]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            402 => 
            array (
                'id' => 903,
                'order' => '29',
                'article_id' => 13,
                'content' => '凡至樂必悲，哭亦悲，皆至其情也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            403 => 
            array (
                'id' => 904,
                'order' => '29',
                'article_id' => 13,
                'content' => '（哀）、樂，其眚（性）相近也，是古（故）其心[29]不遠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            404 => 
            array (
                'id' => 905,
                'order' => '30',
                'article_id' => 13,
                'content' => '哭之（動）心也，（），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:54',
            ),
            405 => 
            array (
                'id' => 906,
                'order' => '30',
                'article_id' => 13,
                'content' => '其（？）女（如）也，（戚）肰（然）以終。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:54',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            406 => 
            array (
                'id' => 907,
                'order' => '30',
                'article_id' => 13,
                'content' => '樂之（動）心也，[30]（？）深舀，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            407 => 
            array (
                'id' => 908,
                'order' => '31',
                'article_id' => 13,
                'content' => '其（？）則流女（如）也以悲，條肰（然）以思。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            408 => 
            array (
                'id' => 909,
                'order' => '31',
                'article_id' => 13,
                'content' => '凡（憂）思而句（後）悲，[31]凡樂思而句（後）忻。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            409 => 
            array (
                'id' => 910,
                'order' => '32',
                'article_id' => 13,
                'content' => '凡思之甬（用）心為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            410 => 
            array (
                'id' => 911,
                'order' => '32',
                'article_id' => 13,
                'content' => '戁（難），思之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            411 => 
            array (
                'id' => 912,
                'order' => '32',
                'article_id' => 13,
                'content' => '其聖（聲）【則】□□□，[32]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            412 => 
            array (
                'id' => 913,
                'order' => '33',
                'article_id' => 13,
                'content' => '其心則其聖（聲）亦肰（然）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            413 => 
            array (
                'id' => 914,
                'order' => '33',
                'article_id' => 13,
                'content' => '游（哀）也，喿遊樂也，遊聖（聲），遊心也。[33]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            414 => 
            array (
                'id' => 915,
                'order' => '34',
                'article_id' => 13,
                'content' => '（喜）斯慆，慆斯奮，奮斯羕（咏），羕（咏）斯猷，猷斯。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:55',
            ),
            415 => 
            array (
                'id' => 916,
                'order' => '34',
                'article_id' => 13,
                'content' => '，（喜）之終也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:55',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            416 => 
            array (
                'id' => 917,
                'order' => '34',
                'article_id' => 13,
                'content' => '（慍）斯（憂），（憂）斯，[34]斯戁，戁斯，斯通。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            417 => 
            array (
                'id' => 918,
                'order' => '35',
                'article_id' => 13,
                'content' => '通，（慍）之終也。[35]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            418 => 
            array (
                'id' => 919,
                'order' => '36',
                'article_id' => 13,
                'content' => '凡學者隶〈求〉其心為難，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            419 => 
            array (
                'id' => 920,
                'order' => '36',
                'article_id' => 13,
                'content' => '從其所為，（近）得之壴（矣），不女（如）以樂之速也。[36]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            420 => 
            array (
                'id' => 921,
                'order' => '37',
                'article_id' => 13,
                'content' => '唯（雖）能其事，不能其心，不貴。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            421 => 
            array (
                'id' => 922,
                'order' => '37',
                'article_id' => 13,
                'content' => '求其心又（有）為也，弗得之壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            422 => 
            array (
                'id' => 923,
                'order' => '37',
                'article_id' => 13,
                'content' => '人之不能以為也，[37]可智（知）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            423 => 
            array (
                'id' => 924,
                'order' => '38',
                'article_id' => 13,
                'content' => '□（過）十（舉），其心必才（在）安（焉），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            424 => 
            array (
                'id' => 925,
                'order' => '38',
                'article_id' => 13,
                'content' => '其見者，青（情）安（失）才（哉）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            425 => 
            array (
                'id' => 926,
                'order' => '38',
                'article_id' => 13,
                'content' => '，宜（義）之方也。[38]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:56',
            ),
            426 => 
            array (
                'id' => 927,
                'order' => '39',
                'article_id' => 13,
                'content' => '宜（義），敬之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:56',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            427 => 
            array (
                'id' => 928,
                'order' => '39',
                'article_id' => 13,
                'content' => '敬，勿（物）之即也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            428 => 
            array (
                'id' => 929,
                'order' => '39',
                'article_id' => 13,
                'content' => '（篤），（仁）之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            429 => 
            array (
                'id' => 930,
                'order' => '39',
                'article_id' => 13,
                'content' => '（仁），眚（性）之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            430 => 
            array (
                'id' => 931,
                'order' => '39',
                'article_id' => 13,
                'content' => '眚（性）或生之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            431 => 
            array (
                'id' => 932,
                'order' => '39',
                'article_id' => 13,
                'content' => '忠，信[39]之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            432 => 
            array (
                'id' => 933,
                'order' => '40',
                'article_id' => 13,
                'content' => '信，青（情）之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            433 => 
            array (
                'id' => 934,
                'order' => '40',
                'article_id' => 13,
                'content' => '青（情）出於眚（性）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            434 => 
            array (
                'id' => 935,
                'order' => '40',
                'article_id' => 13,
                'content' => '（愛）頪（類）七，唯眚（性）（愛）為近（仁）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            435 => 
            array (
                'id' => 936,
                'order' => '40',
                'article_id' => 13,
                'content' => '智頪（類）五，唯[40]宜（義）（道）為忻（近）忠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            436 => 
            array (
                'id' => 937,
                'order' => '41',
                'article_id' => 13,
                'content' => '亞（惡）頪（類）參（三），唯亞（惡）不（仁）為忻（近）宜（義）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            437 => 
            array (
                'id' => 938,
                'order' => '41',
                'article_id' => 13,
                'content' => '所為（道）者四，唯人（道）為[41]可（道）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            438 => 
            array (
                'id' => 939,
                'order' => '42',
                'article_id' => 13,
                'content' => '凡甬（用）心之喿（躁）者，思為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            439 => 
            array (
                'id' => 940,
                'order' => '42',
                'article_id' => 13,
                'content' => '甬（用）智之疾者，患為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            440 => 
            array (
                'id' => 941,
                'order' => '42',
                'article_id' => 13,
                'content' => '甬（用）青（情）之[42]至者，（哀）樂為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            441 => 
            array (
                'id' => 942,
                'order' => '43',
                'article_id' => 13,
                'content' => '甬（用）身之（弁）者，兌（悅）為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:57',
                'updated_at' => '2016-12-07 02:05:57',
            ),
            442 => 
            array (
                'id' => 943,
                'order' => '43',
                'article_id' => 13,
                'content' => '甬（用）力之（盡）者，利為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            443 => 
            array (
                'id' => 944,
                'order' => '43',
                'article_id' => 13,
                'content' => '目之好[43]色，耳之樂聖（聲），舀之（氣）也，人不難為之死。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            444 => 
            array (
                'id' => 945,
                'order' => '44',
                'article_id' => 13,
                'content' => '又（有）其為人之女（如）也，[44]不又（有）夫柬柬之心則采。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            445 => 
            array (
                'id' => 946,
                'order' => '45',
                'article_id' => 13,
                'content' => '又（有）其為人之柬柬女（如）也，不又（有）夫亙（恆）怡之志則縵。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            446 => 
            array (
                'id' => 947,
                'order' => '45',
                'article_id' => 13,
                'content' => '人之攷（巧）[45]言利（詞）者，不又（有）夫詘詘之心則流。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            447 => 
            array (
                'id' => 948,
                'order' => '46',
                'article_id' => 13,
                'content' => '人之肰（然）可與和安者，不又（有）夫（奮）[46]之青（情）則。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            448 => 
            array (
                'id' => 949,
                'order' => '47',
                'article_id' => 13,
                'content' => '又（有）其為人之快女（如）也，弗牧不可。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            449 => 
            array (
                'id' => 950,
                'order' => '47',
                'article_id' => 13,
                'content' => '又（有）其為人之葲女（如）也，[48]弗不足。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            450 => 
            array (
                'id' => 951,
                'order' => '48',
                'article_id' => 13,
                'content' => '凡人為可亞（惡）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            451 => 
            array (
                'id' => 952,
                'order' => '48',
                'article_id' => 13,
                'content' => '斯壴（矣），斯慮壴（矣），慮斯莫與之[48]結壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            452 => 
            array (
                'id' => 953,
                'order' => '49',
                'article_id' => 13,
                'content' => '（慎），（仁）之方也，肰（然）而其（過）不亞（惡）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            453 => 
            array (
                'id' => 954,
                'order' => '49',
                'article_id' => 13,
                'content' => '速，（謀）之方也，又（有）（過）則咎。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            454 => 
            array (
                'id' => 955,
                'order' => '49',
                'article_id' => 13,
                'content' => '人不（慎）斯又（有）（過），信壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            455 => 
            array (
                'id' => 956,
                'order' => '50',
                'article_id' => 13,
                'content' => '凡人青（情）為可兌（悅）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:58',
            ),
            456 => 
            array (
                'id' => 957,
                'order' => '50',
                'article_id' => 13,
                'content' => '句（苟）以其青（情），唯（雖）（過）不亞（惡）；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:58',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            457 => 
            array (
                'id' => 958,
                'order' => '50',
                'article_id' => 13,
                'content' => '不以其青（情），唯（雖）難不貴。[50]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            458 => 
            array (
                'id' => 959,
                'order' => '51',
                'article_id' => 13,
                'content' => '句（苟）又（有）其青（情），唯（雖）未之為，斯人信之壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            459 => 
            array (
                'id' => 960,
                'order' => '51',
                'article_id' => 13,
                'content' => '未言而信，又（有）（美）青（情）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            460 => 
            array (
                'id' => 961,
                'order' => '51',
                'article_id' => 13,
                'content' => '未（教）[51]而民亙（恆），眚（性）善者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            461 => 
            array (
                'id' => 962,
                'order' => '52',
                'article_id' => 13,
                'content' => '未賞而民懽（勸），含福者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            462 => 
            array (
                'id' => 963,
                'order' => '52',
                'article_id' => 13,
                'content' => '未型（刑）而民愄（畏），又（有）[52]心愄（畏）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            463 => 
            array (
                'id' => 964,
                'order' => '53',
                'article_id' => 13,
                'content' => '戔（賤）而民貴之，又（有）惪（德）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:05:59',
                'updated_at' => '2016-12-07 02:05:59',
            ),
            464 => 
            array (
                'id' => 965,
                'order' => '53',
                'article_id' => 13,
                'content' => '貧而民聚安（焉），又（有）（道）者也。[53]',
