                'order' => '9',
                'article_id' => 14,
                'content' => '□□者，又（有）□者；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:05',
                'updated_at' => '2016-12-07 02:06:05',
            ),
            28 => 
            array (
                'id' => 1029,
                'order' => '9',
                'article_id' => 14,
                'content' => '此六戠（職）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:05',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            29 => 
            array (
                'id' => 1030,
                'order' => '9',
                'article_id' => 14,
                'content' => '既又（有）[9]夫六立（位）也，以（任）此□□【也】，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            30 => 
            array (
                'id' => 1031,
                'order' => '10',
                'article_id' => 14,
                'content' => '六戠（職）既分，以六惪（德）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            31 => 
            array (
                'id' => 1032,
                'order' => '10',
                'article_id' => 14,
                'content' => '六惪（德）者[10]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            32 => 
            array (
                'id' => 1033,
                'order' => '11',
                'article_id' => 14,
                'content' => '……賞慶安（焉），智（知）其以又（有）所（歸）也，材[11]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            33 => 
            array (
                'id' => 1034,
                'order' => '12',
                'article_id' => 14,
                'content' => '唯（雖）才（在）山岳（？）之（中），句（苟）臤（賢）[12]……',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            34 => 
            array (
                'id' => 1035,
                'order' => '13',
                'article_id' => 14,
                'content' => '……□父兄（任）者，子弟大材埶（藝）者[13]大官，少（小）材埶（藝）者少（小）官，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            35 => 
            array (
                'id' => 1036,
                'order' => '14',
                'article_id' => 14,
                'content' => '因而它（施）（祿）安（焉），（使）之足以生，足以死，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            36 => 
            array (
                'id' => 1037,
                'order' => '14',
                'article_id' => 14,
                'content' => '胃（謂）[14]之君，以宜（義）（使）人多。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            37 => 
            array (
                'id' => 1038,
                'order' => '15',
                'article_id' => 14,
                'content' => '宜（義）者，君惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:06',
            ),
            38 => 
            array (
                'id' => 1039,
                'order' => '15',
                'article_id' => 14,
                'content' => '非我血（氣）之新（親），畜我女（如）其[15]子弟，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:06',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            39 => 
            array (
                'id' => 1040,
                'order' => '16',
                'article_id' => 14,
                'content' => '古（故）曰：句（苟）淒夫人之善（勞）其之力弗敢單（憚）也，[16]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            40 => 
            array (
                'id' => 1041,
                'order' => '17',
                'article_id' => 14,
                'content' => '危其死弗敢（愛）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            41 => 
            array (
                'id' => 1042,
                'order' => '17',
                'article_id' => 14,
                'content' => '胃（謂）之以忠（事）人多。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            42 => 
            array (
                'id' => 1043,
                'order' => '17',
                'article_id' => 14,
                'content' => '忠者，臣惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            43 => 
            array (
                'id' => 1044,
                'order' => '17',
                'article_id' => 14,
                'content' => '智（知）可[17]為者，智（知）不可為者，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            44 => 
            array (
                'id' => 1045,
                'order' => '18',
                'article_id' => 14,
                'content' => '智（知）行者，智（知）不行者，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            45 => 
            array (
                'id' => 1046,
                'order' => '18',
                'article_id' => 14,
                'content' => '胃（謂）之夫，以智（率）人多。[18]',
