                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            47 => 
            array (
                'id' => 1048,
                'order' => '19',
                'article_id' => 14,
                'content' => '能與之齊，終身弗改之壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:07',
            ),
            48 => 
            array (
                'id' => 1049,
                'order' => '19',
                'article_id' => 14,
                'content' => '是古（故）夫死又（有）宔（主），終[19]身不（變），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:07',
                'updated_at' => '2016-12-07 02:06:08',
            ),
            49 => 
            array (
                'id' => 1050,
                'order' => '20',
                'article_id' => 14,
                'content' => '胃（謂）之婦，以信從人多也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:08',
                'updated_at' => '2016-12-07 02:06:08',
            ),
            50 => 
            array (
                'id' => 1051,
                'order' => '20',
                'article_id' => 14,
                'content' => '信也者，婦惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:08',
                'updated_at' => '2016-12-07 02:06:08',
            ),
            51 => 
            array (
                'id' => 1052,
                'order' => '20',
                'article_id' => 14,
                'content' => '既生畜之，[20]或從而（教）（誨）之，胃（謂）之聖。',
