                'created_at' => '2016-12-07 02:06:08',
                'updated_at' => '2016-12-07 02:06:08',
            ),
            54 => 
            array (
                'id' => 1055,
                'order' => '22',
                'article_id' => 14,
                'content' => '上共下之宜（義），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:08',
                'updated_at' => '2016-12-07 02:06:08',
            ),
            55 => 
            array (
                'id' => 1056,
                'order' => '22',
                'article_id' => 14,
                'content' => '以，胃（謂）之孝，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:08',
                'updated_at' => '2016-12-07 02:06:08',
            ),
            56 => 
            array (
                'id' => 1057,
                'order' => '22',
                'article_id' => 14,
                'content' => '古（故）人則為[22]□□□□（仁）。',
