                'updated_at' => '2016-12-07 02:06:08',
            ),
            57 => 
            array (
                'id' => 1058,
                'order' => '23',
                'article_id' => 14,
                'content' => '（仁）者，子惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:08',
                'updated_at' => '2016-12-07 02:06:09',
            ),
            58 => 
            array (
                'id' => 1059,
                'order' => '23',
                'article_id' => 14,
                'content' => '古（故）夫夫，婦婦，父父，子子，君君，臣臣，六者客（各）[23]行其戠（職）而亡（由）迮（作）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:09',
                'updated_at' => '2016-12-07 02:06:09',
            ),
            59 => 
            array (
                'id' => 1060,
                'order' => '24',
                'article_id' => 14,
                'content' => '雚（觀）者（諸）（詩）、箸（書）則亦才（在）壴（矣），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:09',
                'updated_at' => '2016-12-07 02:06:09',
            ),
            60 => 
            array (
                'id' => 1061,
                'order' => '24',
                'article_id' => 14,
                'content' => '雚（觀）者（諸）[24]豊（禮）、樂則亦才（在）壴（矣），',
