            344 => 
            array (
                'id' => 1345,
                'order' => '44',
                'article_id' => 17,
                'content' => '衣（依）勿（物）以青（情）行之者，[44]卯則（犯）也。[45]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:37',
