                'order' => '46',
                'article_id' => 17,
                'content' => '彊（強）之（尌）也，彊（強）取之也。[46]莫得膳（善）其所。[47]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:37',
