                'updated_at' => '2016-12-07 02:06:39',
            ),
            375 => 
            array (
                'id' => 1376,
                'order' => '1',
                'article_id' => 18,
                'content' => '非言不，非惪（德）亡復。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:39',
                'updated_at' => '2016-12-07 02:06:39',
            ),
            376 => 
            array (
                'id' => 1377,
                'order' => '1',
                'article_id' => 18,
                'content' => '言[1]而狗（苟），（牆）又（有）耳。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:39',
                'updated_at' => '2016-12-07 02:06:39',
            ),
            377 => 
            array (
                'id' => 1378,
                'order' => '2',
                'article_id' => 18,
                'content' => '往言剔（傷）人，（來）言剔（傷）（己）。[2]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            378 => 
            array (
                'id' => 1379,
                'order' => '3',
                'article_id' => 18,
                'content' => '言之善，足以終殜（世）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            379 => 
            array (
                'id' => 1380,
                'order' => '3',
                'article_id' => 18,
                'content' => '參（三）殜（世）之福（富？），不足以出芒（亡）。[3]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            380 => 
            array (
                'id' => 1381,
                'order' => '4',
                'article_id' => 18,
                'content' => '口不誓（慎）而（戶）之閟（閉），亞（惡）言復己而死無日。[4]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            381 => 
            array (
                'id' => 1382,
                'order' => '5',
                'article_id' => 18,
                'content' => '凡敓（說）之道，級者為首。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            382 => 
            array (
                'id' => 1383,
                'order' => '5',
                'article_id' => 18,
                'content' => '既得其級，言必又（有）及[5]之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            383 => 
            array (
                'id' => 1384,
                'order' => '5',
                'article_id' => 18,
                'content' => '及之而不可，必以訛，母（毋）命（令）智（知）我。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            384 => 
            array (
                'id' => 1385,
                'order' => '6',
                'article_id' => 18,
                'content' => '皮（彼）邦芒（亡）[6]（將），流澤而行。[7]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            385 => 
            array (
                'id' => 1386,
                'order' => '8',
                'article_id' => 18,
                'content' => '（竊）鉤（鈎）者（誅），（竊）邦者為者（諸）侯。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            386 => 
            array (
                'id' => 1387,
                'order' => '8',
                'article_id' => 18,
                'content' => '者（諸）侯之門，義士[8]之所廌（存）。[9]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:40',
            ),
            387 => 
            array (
                'id' => 1388,
                'order' => '10',
                'article_id' => 18,
                'content' => '車（）之（）酭（），不見江沽（湖）之水。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:40',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            388 => 
            array (
                'id' => 1389,
                'order' => '10',
                'article_id' => 18,
                'content' => '佖婦禺夫，[10]不智（知）其向（鄉）之小人、君子。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            389 => 
            array (
                'id' => 1390,
                'order' => '11',
                'article_id' => 18,
                'content' => '飤（食）韭亞（惡）智（知）終其。[11]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            390 => 
            array (
                'id' => 1391,
                'order' => '12',
                'article_id' => 18,
                'content' => '（早）與臤（賢）人，是胃（謂）（詇）行。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            391 => 
            array (
                'id' => 1392,
                'order' => '12',
                'article_id' => 18,
                'content' => '臤（賢）人不才（在）昃（側），是[12]胃（謂）迷惑。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            392 => 
            array (
                'id' => 1393,
                'order' => '13',
                'article_id' => 18,
                'content' => '不與智（謀），是胃（謂）自惎（誋）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            393 => 
            array (
                'id' => 1394,
                'order' => '13',
                'article_id' => 18,
                'content' => '（早）與智（謀），是[13]胃（謂）童（重）基（惎）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            394 => 
            array (
                'id' => 1395,
                'order' => '14',
                'article_id' => 18,
                'content' => '邦又（有）巨（雄），必先與之以為（朋）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            395 => 
            array (
                'id' => 1396,
                'order' => '14',
                'article_id' => 18,
                'content' => '唯戁[14]之而弗亞（惡），必（盡）其古（故）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            396 => 
            array (
                'id' => 1397,
                'order' => '15',
                'article_id' => 18,
                'content' => '（盡）之而（疑），必鋊鋊[15]其。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            397 => 
            array (
                'id' => 1398,
                'order' => '16',
                'article_id' => 18,
                'content' => '女（如）（將）又（有）敗，（雄）是為割（害）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            398 => 
            array (
                'id' => 1399,
                'order' => '16',
                'article_id' => 18,
                'content' => '利木（陰）者，不折[16]其。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            399 => 
            array (
                'id' => 1400,
                'order' => '17',
                'article_id' => 18,
                'content' => '利其渚者，不賽（塞）其（溪）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            400 => 
            array (
                'id' => 1401,
                'order' => '17',
                'article_id' => 18,
                'content' => '善（使）其下，若[17]（蛩）之足，眾而不割（害），割（害）而不僕（仆）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:41',
                'updated_at' => '2016-12-07 02:06:41',
            ),
            401 => 
            array (
                'id' => 1402,
                'order' => '18',
                'article_id' => 18,
                'content' => '善事其上[18]者，若齒之事（舌），而終弗（憒）。',
