            402 => 
            array (
                'id' => 1403,
                'order' => '19',
                'article_id' => 18,
                'content' => '善□□□[19]者，若兩輪之相，而終不相敗。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            403 => 
            array (
                'id' => 1404,
                'order' => '20',
                'article_id' => 18,
                'content' => '善（使）[20]其民者，若四（時）一遣一（來），而民弗害也。[21]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            404 => 
            array (
                'id' => 1405,
                'order' => '22',
                'article_id' => 18,
                'content' => '山亡（？）則坨（阤），成（城）無蓑則坨（阤）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            405 => 
            array (
                'id' => 1406,
                'order' => '22',
                'article_id' => 18,
                'content' => '士亡双（友）不可，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            406 => 
            array (
                'id' => 1407,
                'order' => '22',
                'article_id' => 18,
                'content' => '君又（有）[22]（謀）臣，則壤（地）不鈔。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            407 => 
            array (
                'id' => 1408,
                'order' => '23',
                'article_id' => 18,
                'content' => '士又（有）（謀）双（友）則言談不[23]甘（？）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            408 => 
            array (
                'id' => 1409,
                'order' => '24',
                'article_id' => 18,
                'content' => '唯（雖）（勇）力（聞）於邦不女（如）材，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            409 => 
            array (
                'id' => 1410,
                'order' => '24',
                'article_id' => 18,
                'content' => '金玉浧（盈）室不[24]女（如）（謀），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            410 => 
            array (
                'id' => 1411,
                'order' => '25',
                'article_id' => 18,
                'content' => '眾強甚多不女（如）（時）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            411 => 
            array (
                'id' => 1412,
                'order' => '25',
                'article_id' => 18,
                'content' => '古（故）（謀）為可貴。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            412 => 
            array (
                'id' => 1413,
                'order' => '25',
                'article_id' => 18,
                'content' => '（一）[25]（家）事乃又（有），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            413 => 
            array (
                'id' => 1414,
                'order' => '26',
                'article_id' => 18,
                'content' => '三（雄）一（雌），三一，一王母[26]保三殹兒。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:42',
            ),
            414 => 
            array (
                'id' => 1415,
                'order' => '27',
                'article_id' => 18,
                'content' => '聖君而會，視（朝）而內（入）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:42',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            415 => 
            array (
                'id' => 1416,
                'order' => '27背',
                'article_id' => 18,
                'content' => '內（入）之或內（入）之，至之或至之之，至而亡及也已。[27,27背]"',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            416 => 
            array (
                'id' => 1417,
                'order' => '1',
                'article_id' => 20,
                'content' => '行此者丌（其）又（有）不王（乎）▃？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            417 => 
            array (
                'id' => 1418,
                'order' => '1',
                'article_id' => 20,
                'content' => '孔（孔子）曰：（詩）亡（離）志，樂亡（離）情，（文）亡（離）言',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            418 => 
            array (
                'id' => 1419,
                'order' => '2',
                'article_id' => 20,
                'content' => '寺也，文王受命矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            419 => 
            array (
                'id' => 1420,
                'order' => '2',
                'article_id' => 20,
                'content' => '訟坪（平）惪（德）也，多言（後）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            420 => 
            array (
                'id' => 1421,
                'order' => '2',
                'article_id' => 20,
                'content' => '丌（其）樂安而屖，丌（其）訶（歌）紳（壎）而（箎），丌（其）思深而遠，至矣！',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:43',
            ),
            421 => 
            array (
                'id' => 1422,
                'order' => '2',
                'article_id' => 20,
                'content' => '大（夏）盛惪（德）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:43',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            422 => 
            array (
                'id' => 1423,
                'order' => '2',
                'article_id' => 20,
                'content' => '多言',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            423 => 
            array (
                'id' => 1424,
                'order' => '3',
                'article_id' => 20,
                'content' => '多言難而（悁）退（懟）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            424 => 
            array (
                'id' => 1425,
                'order' => '3',
                'article_id' => 20,
                'content' => '衰矣少矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            425 => 
            array (
                'id' => 1426,
                'order' => '3',
                'article_id' => 20,
                'content' => '邦風丌（其）內（納）勿（物）也，尃（溥）（觀）人谷（俗）安（焉），大（歛）材安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            426 => 
            array (
                'id' => 1427,
                'order' => '3',
                'article_id' => 20,
                'content' => '丌（其）言（文），丌（其）聖（聲）善。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            427 => 
            array (
                'id' => 1428,
                'order' => '3',
                'article_id' => 20,
                'content' => '孔（孔子）曰：隹（唯）能夫',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            428 => 
            array (
                'id' => 1429,
                'order' => '4',
                'article_id' => 20,
                'content' => '曰：詩丌（其）猷坪（平）門，與（賤）民而之，丌（其）甬（用）心也（將）可（何）女（如）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            429 => 
            array (
                'id' => 1430,
                'order' => '4',
                'article_id' => 20,
                'content' => '曰：邦風氏（是）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:44',
                'updated_at' => '2016-12-07 02:06:44',
            ),
            430 => 
            array (
                'id' => 1431,
                'order' => '4',
                'article_id' => 20,
                'content' => '民之又（罷）（惓）也，卡（上下）之不和者，丌（其）甬（用）心也（將）可（何）女（如）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            431 => 
            array (
                'id' => 1432,
                'order' => '5',
                'article_id' => 20,
                'content' => '氏（是）也，又城（成）工（功）者可（何）女（如），曰訟氏（是）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            432 => 
            array (
                'id' => 1433,
                'order' => '5',
                'article_id' => 20,
                'content' => '清（廟）王惪（德）也，至矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            433 => 
            array (
                'id' => 1434,
                'order' => '5',
                'article_id' => 20,
                'content' => '敬宗（廟）之豊（禮），（以）為丌（其）（本），秉（文）之惪（德），（以）為丌（其），肅（雍）……',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            434 => 
            array (
                'id' => 1435,
                'order' => '6',
                'article_id' => 20,
                'content' => '多士，秉（文）之惪（德），（吾）敬之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            435 => 
            array (
                'id' => 1436,
                'order' => '6',
                'article_id' => 20,
                'content' => '（烈）（文）曰：乍競隹（唯）人，不（丕）（顯）隹（唯）惪（德）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            436 => 
            array (
                'id' => 1437,
                'order' => '6',
                'article_id' => 20,
                'content' => '於（呼）！前王不忘，（吾）敓（悅）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            437 => 
            array (
                'id' => 1438,
                'order' => '6',
                'article_id' => 20,
                'content' => '昊（昊天）又城（成）命，二后受之，貴（且）（顯）矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            438 => 
            array (
                'id' => 1439,
                'order' => '6',
                'article_id' => 20,
                'content' => '訟',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            439 => 
            array (
                'id' => 1440,
                'order' => '7',
                'article_id' => 20,
                'content' => '褱（懷）尔（明）惪（德）害（曷），城（誠）胃（謂）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            440 => 
            array (
                'id' => 1441,
                'order' => '7',
                'article_id' => 20,
                'content' => '又（有）命自天，命此文王，城（誠）命之也，信矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:45',
                'updated_at' => '2016-12-07 02:06:45',
            ),
            441 => 
            array (
                'id' => 1442,
                'order' => '7',
                'article_id' => 20,
                'content' => '孔（孔子）曰：此命也夫。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            442 => 
            array (
                'id' => 1443,
                'order' => '7',
                'article_id' => 20,
                'content' => '文王隹（唯）谷（裕）也，（得）（乎）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            443 => 
            array (
                'id' => 1444,
                'order' => '7',
                'article_id' => 20,
                'content' => '此命也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            444 => 
            array (
                'id' => 1445,
                'order' => '8',
                'article_id' => 20,
                'content' => '十月善諀（諞）言。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            445 => 
            array (
                'id' => 1446,
                'order' => '8',
                'article_id' => 20,
                'content' => '雨亡政、即南山，皆言上之衰也，王公恥之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            446 => 
            array (
                'id' => 1447,
                'order' => '8',
                'article_id' => 20,
                'content' => '少（文）多（疑矣），言不中志者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            447 => 
            array (
                'id' => 1448,
                'order' => '8',
                'article_id' => 20,
                'content' => '少丌（其）言不亞（惡），少又安。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            448 => 
            array (
                'id' => 1449,
                'order' => '8',
                'article_id' => 20,
                'content' => '少、考言，則言人之害也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            449 => 
            array (
                'id' => 1450,
                'order' => '8',
                'article_id' => 20,
                'content' => '伐木',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            450 => 
            array (
                'id' => 1451,
                'order' => '9',
                'article_id' => 20,
                'content' => '咎於其也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            451 => 
            array (
                'id' => 1452,
                'order' => '9',
                'article_id' => 20,
                'content' => '天保丌（其）（得）彔（祿）畺（疆）矣，巽（饌）（寡），惪（德）古（故）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            452 => 
            array (
                'id' => 1453,
                'order' => '9',
                'article_id' => 20,
                'content' => '誶父之（責）亦又（有）（以）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            453 => 
            array (
                'id' => 1454,
                'order' => '9',
                'article_id' => 20,
                'content' => '黃則困而谷（欲）反丌（其）古也，多恥者丌（其）之（乎）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            454 => 
            array (
                'id' => 1455,
                'order' => '9',
                'article_id' => 20,
                'content' => '（）者莪則（以）人（益）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:46',
                'updated_at' => '2016-12-07 02:06:46',
            ),
            455 => 
            array (
                'id' => 1456,
                'order' => '9',
                'article_id' => 20,
                'content' => '（）者芋則',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:47',
                'updated_at' => '2016-12-07 02:06:47',
            ),
            456 => 
            array (
                'id' => 1457,
                'order' => '10',
                'article_id' => 20,
                'content' => '疋之攺（怡），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:47',
                'updated_at' => '2016-12-07 02:06:47',
            ),
            457 => 
            array (
                'id' => 1458,
                'order' => '10',
                'article_id' => 20,
                'content' => '梂木之（時），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:47',
                'updated_at' => '2016-12-07 02:06:47',
            ),
            458 => 
            array (
                'id' => 1459,
                'order' => '10',
                'article_id' => 20,
                'content' => '灘之（智），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:47',
                'updated_at' => '2016-12-07 02:06:47',
            ),
            459 => 
            array (
                'id' => 1460,
                'order' => '10',
                'article_id' => 20,
                'content' => '槕之（歸），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:47',
                'updated_at' => '2016-12-07 02:06:47',
            ),
            460 => 
            array (
                'id' => 1461,
                'order' => '10',
                'article_id' => 20,
                'content' => '甘棠之保（褒），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-07 02:06:47',
                'updated_at' => '2016-12-07 02:06:47',
            ),
            461 => 
            array (
                'id' => 1462,
                'order' => '10',
                'article_id' => 20,
                'content' => '綠衣之思，',
                'slip_pic' => NULL,
